import React from "react";
import "./Lessons.css";

const Lessons = () => {
  const lessons = Array.from({ length: 20 }, (_, i) => `Урок ${i + 1}`);

  return (
    <div className="page lessons">
      <h2>Уроки английского языка</h2>
      <ul>
        {lessons.map((lesson, index) => (
          <li key={index}>{lesson}</li>
        ))}
      </ul>
    </div>
  );
};

export default Lessons;
